import './App.css';
import Navbar from './Navbar.js';
import About from './About.js';

function App() {
    return (
        <div className="App">

            <Navbar/>

            <h1 class="heading">Software Engineering Class SFSU</h1>
            <h2 class="heading">Section 4</h2>
            <h3 class="heading">Team 02</h3>

            <div class="membercontainer">
                <About/>
            </div>
        </div>
    );
}

export default App;
